def input='''



'''

// def input = '''ULL
// RRDDD
// LURDL
// UUUUD'''

def instr = [
    L: -1,
    R: 1,
    U: -1,
    D: 1
]

//Part1
// def keypad = [
//     ['1', '2', '3'],
//     ['4', '5', '6'],
//     ['7', '8', '9']
// ]

//Part2
def keypad = [
    [' ', ' ', '1', ' ', ' '],
    [' ', '2', '3', '4', ' '],
    ['5', '6', '7', '8', '9'],
    [' ', 'A', 'B', 'C', ' '],
    [' ', ' ', 'D', ' ', ' ']
]
def currentRow = 2
def currentCol = 0
def rowSize = keypad[0].size()
def colSize = keypad.size()
input.eachLine{ line ->
    line.split('').each{ move ->
        switch(move){
            case ["L", "R"]:
                def calc = currentCol + instr[move]
                if(calc >=0 && calc < rowSize){
                    if(keypad[currentRow][calc].trim()){
                        currentCol = calc;
                    }
                }
                break;
            case ["U", "D"]:
                def calc = currentRow + instr[move];
                if(calc >=0 && calc < colSize){
                    if(keypad[calc][currentCol].trim()){
                        currentRow = calc
                    }
                }
                break;
        }
    }
    print keypad[currentRow][currentCol]
}
